import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import axios from 'axios';

function Register(){
  const navigate = useNavigate();
  const [usernameReg, setusernameReg]= useState('')
  const [passwordReg, setpasswordReg]= useState('');
  const [emailReg, setemailReg]= useState('');


  const handleRegister = async (event)=> {
    event.preventDefault(); 

    try{
      console.log('xyz')
    const response = await axios.post('http://localhost:4000/api/auth', {username: usernameReg,
  email: emailReg , password: passwordReg});
  console.log(response.data) ;
  navigate('/homepage');
    }
    catch(error){
      console.log(error); 
    }

  };


  return (
    <div className="content">
      <div className="form">
        <div className="smallheader"> Register</div>
        <hr className="tag" />
        <form onSubmit={handleRegister}>
          <div className="form-group">
            <label htmlFor='username'>Username</label>
            <input
              type="text"
              name="username"
              placeholder="username"
              value={usernameReg}
              onChange={(e) => setusernameReg(e.target.value)}
            />
          </div>
          <div className="form-group">
            <label htmlFor='username'>Email</label>
            <input
              type="text"
              name="email"
              placeholder="email"
              value={emailReg}
              onChange={(e) => setemailReg(e.target.value)}
            />
          </div>
          <div className="form-group">
            <label htmlFor='password'>Password</label>
            <input
              type="password"
              name="password"
              placeholder="password"
              value={passwordReg}
              onChange={(e) => setpasswordReg(e.target.value)}
            />
          </div>
          <div className="footer">
            <button type="submit" className="button" onClick={handleRegister}>
              Register
            </button>
            <div>
              <label>Already a member?</label>
              <button className="button" onClick={() => navigate('/')}>
                Login
              </button>
            </div>
          </div>
        </form>
      </div>
    </div>
  );
}

export default Register;
